import { Rating } from "@mui/material";
import IProffisional from "../../../types/IProfissional";

function Card({profissional}: {profissional: IProffisional}) {
    return (
        <div>
            <ul>
                <li>
                    <img src={profissional.imagem} alt={`Foto de perfil do profissional ${profissional.nome}`} />
                </li>
                <li>
                    <p>{profissional.nome}</p>
                    <p>{profissional.especialidade}</p>
                </li>
                <li>
                    <Rating
                        name="simple-controlled"
                        value={profissional.nota}
                        readOnly={true}
                    />
                </li>
            </ul>
        </div>
)}

export default Card;
